import React from 'react';
import Item from "../Item/Item";
import style from "./ItemsList.module.css"
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome'
import { faPlus } from '@fortawesome/free-solid-svg-icons'

const ItemsList = (props) => {
    class image {
        constructor(name, format, encoding, data) {
            this.name = name;
            this.format = format;
            this.encoding = encoding;
            this.data = data;
        }
    }
    const books = [{id: "0", name: "a", titleImageName: "Title", images: [new image("Title", "image/jpeg", "base64", "")]}];
    const items = books.map((item) =>
        <Item updateData = {props.updateData} item = {item} />
    );

    return (
        <div className={style.list_block}>
            <button className={style.button}>
                <FontAwesomeIcon icon={faPlus} size="6x"/>
            </button>
            <ul className={style.list}>
                {items}
            </ul>
        </div>
    )
}

export default ItemsList;